(2, 'privacy_policy', '<h3>Privacy Policy &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</h3><p><strong>Your website may use the privacy policy given below.</strong> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p><p>The terms \\\"we\\\"/\\\"us\\\"/\\\"our\\\"/\\\"Company\\\" individually and collectively refer to SWAMI VIVEKANAND EDUCATIONAL &amp; WELFARE TRUST, and the terms \\\"you\\\"/\\\"your\\\"/\\\"Yourself\\\" refer to the users. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p><p>This Privacy Policy is an electronic record in the form of an electronic contract formed under the Information Technology Act, 2000 and the rules made thereunder and the amended provisions pertaining to electronic documents and records in various statutes as amended by the Information Technology Act, 2000. This Privacy Policy does not require any physical, electronic, or digital signature.</p><p>This Privacy Policy is a legally binding document between you and SWAMI VIVEKANAND EDUCATIONAL &amp; WELFARE TRUST (both terms defined below). The terms of this privacy policy will be effective upon your acceptance of the same (directly or indirectly in electronic form, by clicking on the \\\"I accept\\\" tab, by use of the website or by other means) and will govern the relationship between you and SWAMI VIVEKANAND EDUCATIONAL &amp; WELFARE TRUST for your use of the website (\\\"Website\\\" (defined below). &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p><p>This document is published and shall be construed in accordance with the provisions of the Information Technology (Reasonable security practices and procedures and sensitive personal data information) rules, 2011 under the Information Technology Act, 2000, which requires the publication of the Privacy Policy for the collection, use, storage, and transfer of sensitive personal data or information. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p><p>Please read this privacy statement carefully; by using the Website, you indicate that you understand, agree, and consent to it. If you do not agree with the terms of this privacy policy, please do not use this website. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p><p>By providing us with your information or by making use of the facilities provided by the Website, you hereby consent to the collection, storage, processing, and transfer of any or all of your personal information and non-personal information by us as specified under this Privacy Policy. You also agree that such collection, use, storage, and transfer of your information will not result in any loss or wrongful gain to you or anyone else.</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p><h3>User Information &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</h3><p>To avail certain services on our websites, users are required to provide certain information for the registration process, namely: a) your name, b) email address, c) sex, d) age, e) PIN code, f) credit card, or debit card details g) medical records and history, h) sexual orientation, i) biometric information, j) passwords, and so on, as well as your occupation, interests, and so on. The information supplied by the users enables us to improve our sites and provide you with the most user-friendly experience.</p><p>All required information is service dependent, and we may use the aforementioned user information to maintain, protect, and improve its services (including advertising services), as well as to develop new services. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p><p>Such information will not be considered sensitive if it is freely available and accessible in the public domain or is furnished under the Right to Information Act, 2005 or any other law for the time being in force. &nbsp; &nbsp;&nbsp;</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p><h3>Cookies &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</h3><p>To improve the responsiveness of the sites to our users, we may use \\\"cookies,\\\" or similar electronic tools to collect information to assign each visitor a unique, random number as a User Identification (User ID) to better understand the user\\\'s individual interests using the identified computer. Unless you voluntarily identify yourself (through registration, for example), we will have no way of knowing who you are, even if we assign a cookie to your computer. The only personal information a cookie can contain is information you supply (an example of this is when you ask for our Personalised Horoscope). A cookie can not read data off your hard drive. Our advertisers may also assign their own cookies to your browser (if you click on their ads), a process that we do not control. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p><p>Our web servers automatically collect limited information about your computer\\\'s connection to the Internet, including your IP address, when you visit our site. (Your IP address is a number that lets computers attached to the Internet know where to send you data--such as the web pages you view.) Your IP address does not identify you personally. We use this information to deliver our web pages to you upon request, to tailor our site to the interests of our users, to measure traffic within our site, and to let advertisers know the geographic locations from where our visitors come.</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p><h3>Links to the Other Sites &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</h3><p>Our policy discloses the privacy practices for our own website only. Our site also provides links to other websites that are beyond our control. We will not be held liable for your use of such sites. &nbsp;</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p><h3>Information Sharing &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</h3><p>In the following limited circumstances, we may share sensitive personal information with any third party without obtaining the prior consent of the user: &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p><p><strong>(a) </strong>When requested or required by law or by any court, governmental agency, or authority to disclose, for the purpose of identity verification, or the prevention, detection, and investigation of crimes, including cybercrime, or the prosecution and punishment of offenders.These disclosures are made in the good faith belief that they are reasonably necessary for enforcing these terms and complying with applicable laws and regulations. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p><p><strong>(b) </strong>We propose sharing such information within its group colleges, as well as with officers and employees of such group companies, in order to process personal data on its behalf. We also ensure that these recipients of such information agree to process such information based on our instructions and in compliance with this Privacy Policy and any other appropriate confidentiality and security measures.</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p><h3>Information Security &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</h3><p>We take appropriate security measures to protect against unauthorized access to or unauthorized alteration, disclosure, or destruction of data. These include internal reviews of our data collection, storage, and processing practices and security measures, including appropriate encryption and physical security measures to guard against unauthorized access to systems where we store personal data. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p><p>All information gathered on our website is securely stored within our controlled database. The database is stored on servers secured behind a firewall; access to the servers is password-protected and strictly limited. However, as effective as our security measures are, no security system is impenetrable. We cannot guarantee the security of our database, nor can we guarantee that information you supply will not be intercepted while being transmitted to us over the Internet. And, of course, any information you include in a posting to the discussion areas is available to anyone with Internet access. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p><p>However, the internet is an ever-evolving medium. We may amend our privacy policies from time to time to reflect future changes. Of course, our use of any information we gather will always be consistent with the policy under which the information was collected, regardless of what the new policy may be.<br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p><h3>Grievance Redressal &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</h3><p>Any complaints, abuse, or concerns with regards to content and or comments or breach of these terms shall be immediately informed to the designated Grievance Officer as mentioned below, either in writing or through email signed with an electronic signature to Ashutosh Kumar Basant (\\\"Grievance Officer\\\").<br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p><p>