(4, 'return_refund_cancellation', '<h3>Return, Refund and Cancellation Policy &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</h3><p>Our focus is complete customer satisfaction. In the event that you are displeased with the services provided, we will refund the money provided the reasons are genuine and proven after investigation. Please read the fine print of each deal before buying it. It provides all the details about the services or products you are purchasing. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p><p>In the event of dissatisfaction with our services, clients have the liberty to cancel their projects and request a refund from us. Our policy for the cancellation and refund will be as follows:</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p><h3>Cancellation Policy &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</h3><p>For cancellations, please contact us via the contact us link. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p><p>Requests received later than SWAMI VIVEKANAND EDUCATIONAL &amp; WELFARE TRUST &nbsp;business days prior to the end of the current service period will be treated as cancellations of services for the next service period.</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p><h3>Refund Policy &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</h3><p>We will try our best to create suitable design concepts for our clients. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p><p>In the event that any client is not completely satisfied with our products, we can provide a refund. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p><p>If paid by credit card, refunds will be issued to the original credit card provided at the time of purchase, and in the case of payment gateway name payments, refunds will be made to the same account.</p>', 1, NULL, '2022-03-19 14:22:23', '2022-03-27 07:14:47');
